import React from "react";
import About from "../About";
import NavBar from "./Nav";
const logo = require("../../assets/Kelly.jpg");

const Header = () => {
  return (
    <div className="mt-28 lg:flex">
      <NavBar />

      <div className="px-5">
        <div className="py-4 border-4">
          <h1 className="uppercase font-bold text-7xl">
            Designer/<span className="block">Developer</span>
          </h1>
        </div>
        <div className="border-4 lg:mx-36">
          <p className="pb-6 text-justify text-3xl font-medium li">
            I AM A REACT DEVELOPER AND GRAPHIC DESIGNER BASED IN JAMAICA. I HAVE ONE
            YEAR OF EXPERIENCE IN CRAFTING CLEAN & USER-FRIENDLY ALL AREAS OF
            DIGITAL. I LOVE MINIMAL AND BRUTALIST DESIGN. I LOVE NATURE, MUSIC
            AND I AM PASSIONATE ABOUT BUILDING CREATIVE DESIGNS.
          </p>
        </div>
        <div className="flex justify-center py-4 border-4">
          <button className="inline-block  px-8 py-4 bg-blue-600 text-white font-medium text-xs leading-tight uppercase rounded-full shadow-md hover:bg-blue-700 hover:shadow-lg focus:bg-blue-700 focus:shadow-lg focus:outline-none focus:ring-0 active:bg-blue-800 active:shadow-lg transition duration-150 ease-in-out">
            {" "}
            More About me{" "}
          </button>
        </div>
      </div>
    </div>
  );
};

export default Header;
